css:
.item-count-box {
  float: right;
  min-width: 26px;
  text-align: center;
  display: inline;
  font-size: 12px;
  padding: 1px 5px 1px 5px;
  margin-top: 3.5px;
  line-height: 20.9px;
  border-radius: 3px;
}
.plugins-view-tabs {
  color: rgba(35, 31, 32, 0.8);
  list-style-type: none;
  padding-left: 0;
  cursor: default;
}
.plugins-view-tabs li {
  padding: 10px 16px 10px 16px;
  border-bottom: 1px solid #dddddd;
}
.plugins-view-tabs li.active {
  background: #f6f7f8;
  color: #3187e1;
}
.plugins-view-tabs li.active img.colorfill {
  background: #3187e1;
}
.plugins-view {
  background: #fdfdfd;
  position: absolute;
  width: 100%;
  height: 100%;
}
.plugins-view .new-package {
  margin-bottom: 50px;
}
.plugins-view .installed,
.plugins-view .explore {
  overflow-y: scroll;
  padding-left: 16px;
  height: 100%;
}
.plugins-view .installed .inner,
.plugins-view .explore .inner {
  max-width: 600px;
}
.plugins-view .installed input,
.plugins-view .explore input {
  margin-top: 10px;
  margin-bottom: 10px;
  padding: 4px;
  box-sizing: border-box;
}
.plugins-view .installed .empty,
.plugins-view .explore .empty {
  color: rgba(35, 31, 32, 0.5);
  margin-bottom: 20px;
}
.plugins-view .package-set {
  margin-top: 35px;
}
.plugins-view .package {
  background: #ffffff;
  border: 1px solid #dddddd;
  margin-top: 10px;
  margin-bottom: 10px;
}
.plugins-view .package .padded {
  padding: 10px 16px 10px 16px;
}
.plugins-view .package .title {
  color: #434648;
  cursor: default;
  margin: 0;
  font-size: 18.75px;
  font-weight: 400;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}
.plugins-view .package .description {
  padding-top: 6px;
  color: rgba(35, 31, 32, 0.5);
  font-size: 13.95px;
}
.plugins-view .package .actions {
  float: right;
  text-align: right;
}
.plugins-view .package .actions .btn {
  margin-left: 10px;
}
.plugins-view .package .update-info {
  background: rgba(65, 155, 249, 0.1);
  line-height: 24.2px;
}
.plugins-view .package .update-info .btn {
  float: right;
}
